- (void)loginOrzOSDKSuccess:(NSDictionary *)result {
    NSLog(@"SDKDelegateImpl::loginOrzOSDKSuccess>>>invoked, result = %@", result);
    
    [[OrzOSDK getSharedInstance] showOrzOSDKFloatView];
    
    [OrzOSDKViewController clearTokenAndUserId];
    mToken = [[NSString alloc] initWithString:[result objectForKey:@"juhe_token"]];
    mUserID = [[NSString alloc] initWithFormat:@"%@@%@", [result objectForKey:@"juhe_userid"], [result objectForKey:@"channel_userid"]];
    
    if (loginCb != 0) {
        cocos2d::LuaBridge::pushLuaFunctionById(loginCb);
        cocos2d::LuaBridge::getStack()->executeFunction(0);
        cocos2d::LuaBridge::releaseLuaFunctionById(loginCb);
        
        loginCb = 0;
    }
}

- (void)logoutOrzOSDKFail:(NSDictionary *)result {
    NSLog(@"SDKDelegateImpl::logoutOrzOSDKFail>>>invoked, result = %@", result);
}

- (void)logoutOrzOSDKSuccess:(NSDictionary *)result {
    NSLog(@"SDKDelegateImpl::logoutOrzOSDKSuccess>>>invoked, result = %@", result);
    
    [[OrzOSDK getSharedInstance] hideOrzOSDKFloatView];
    
    [OrzOSDKViewController clearTokenAndUserId];

    if (logoutCb != 0) {
        cocos2d::LuaBridge::pushLuaFunctionById(logoutCb);
        cocos2d::LuaBridge::getStack()->executeFunction(0);
    }
}

