+ (void)init:(NSDictionary *)dict {
    NSLog(@"OrzOSDKViewController::init>>>invoked, dict = %@", dict);
    
    logoutCb = [[dict objectForKey:@"listener"] intValue];
    cocos2d::LuaBridge::retainLuaFunctionById(logoutCb);
    
    // --- sdk begins - 39zy ---
    if (!s_bIsSdkInit) {
        s_pSdkDlg = [[SDKDelegateImpl alloc] init];
        [OrzOSDK getSharedInstance].OrzOSDKDelegate = s_pSdkDlg;
        [[OrzOSDK getSharedInstance] initOrzOSDK];
    }
    // --- sdk ends ---
}

+ (void)login:(NSDictionary *)dict {
    NSLog(@"OrzOSDKViewController::login>>>invoked, dict = %@", dict);
    
    loginCb = [[dict objectForKey:@"listener"] intValue];
    cocos2d::LuaBridge::retainLuaFunctionById(loginCb);
    
    // --- sdk begins - 39zy ---
    if (s_bIsSdkInit) {
        [[OrzOSDK getSharedInstance] startOrzOSDKLogin];
    }
    // --- sdk ends ---
}

