    [OrzOSDKViewController clearTokenAndUserId];
}

+ (void)setUserInfo:(NSDictionary *)dict {
    NSLog(@"OrzOSDKViewController::setUserInfo>>>invoked, dict = %@", dict);
    
    NSString *sceneId = [dict objectForKey:@"sceneId"];
    NSString *serverId = [dict objectForKey:@"serverId"];
    NSString *serverName = [dict objectForKey:@"serverName"];
    NSString *roleId = [dict objectForKey:@"roleId"];
    NSString *roleName = [dict objectForKey:@"roleName"];
    NSString *roleLevel = [dict objectForKey:@"roleLevel"];
    NSString *roleTime = [dict objectForKey:@"roleTime"];
//    NSString *vipLevel = [dict objectForKey:@"vipLevel"];
//    NSString *balance = [dict objectForKey:@"balance"];
//    NSString *gold = [dict objectForKey:@"gold"];
//    NSString *power = [dict objectForKey:@"power"];
    if ([roleName isEqualToString:@""]) {
        roleName = roleId;
    }
    if ([serverName isEqualToString:@""]) {
        serverName = @"";
    }
    
    // --- sdk begins - 39zy ---
    NSMutableDictionary *data = [NSMutableDictionary dictionary];
    [data setValue:roleId forKey:OrzOSDK_ROLE_ID];
    [data setValue:roleLevel forKey:OrzOSDK_ROLE_LEVEL];
    [data setValue:roleName forKey:OrzOSDK_ROLE_NAME];
    [data setValue:roleTime forKey:OrzOSDK_ROLE_CREATE_TIME];
    [data setValue:serverId forKey:OrzOSDK_SERVER_ID];
    [data setValue:serverName forKey:OrzOSDK_SERVER_NAME];
    if ([sceneId isEqualToString:@"0"]) {
        [[OrzOSDK getSharedInstance] sendOrzOSDKData:OrzOSDK_SUBMIT_ROLE_ENTERSERVER
                                                              data:data];
    } else if ([sceneId isEqualToString:@"1"]) {
        [[OrzOSDK getSharedInstance] sendOrzOSDKData:OrzOSDK_SUBMIT_ROLE_CREATE
                                                              data:data];
        [[OrzOSDK getSharedInstance] sendOrzOSDKData:OrzOSDK_SUBMIT_ROLE_ENTERSERVER
                                                              data:data];
    } else {
        [[OrzOSDK getSharedInstance] sendOrzOSDKData:OrzOSDK_SUBMIT_ROLE_LEVELUP
                                                              data:data];
    }
    // --- sdk ends ---
}

+ (void)zhi:(NSDictionary *)dict {
    NSLog(@"OrzOSDKViewController::zhi>>>invoked, dict = %@", dict);
    
    zhiCb = [[dict objectForKey:@"listener"] intValue];
    cocos2d::LuaBridge::retainLuaFunctionById(zhiCb);
    
    NSString *productId = [dict objectForKey:@"productId"];
    NSString *cpOrder = [dict objectForKey:@"cpOrder"];
    NSString *price = [dict objectForKey:@"price"];
    NSString *desc = [dict objectForKey:@"desc"];
    NSString *serverName = [dict objectForKey:@"serverName"];
    NSString *serverId = [dict objectForKey:@"serverId"];
    NSString *roleName = [dict objectForKey:@"roleName"];
    NSString *roleId = [dict objectForKey:@"roleId"];
    NSString *roleLevel = [dict objectForKey:@"roleLevel"];
    NSString *goodsName = [dict objectForKey:@"goodsName"];
//    NSString *goodsId = [dict objectForKey:@"goodsId"];
//    NSString *cpCbUrl = [dict objectForKey:@"cbUrl"];
    if ([roleName isEqualToString:@""]) {
        roleName = roleId;
    }
    if ([serverName isEqualToString:@""]) {
        serverName = @"";
    }
    
    // --- sdk begins - 39zy ---
    NSMutableDictionary *data = [NSMutableDictionary dictionary];
    [data setValue:goodsName forKey:OrzOSDK_IOS_PRODUCT_NAME];
    [data setValue:productId forKey:OrzOSDK_IOS_PRODUCT_ID];
    [data setValue:cpOrder forKey:OrzOSDK_IOS_CP_ORDERID];
    [data setValue:goodsName forKey:OrzOSDK_IOS_PRODUCT_DESC];
    [data setValue:price forKey:OrzOSDK_IOS_PRODUCT_PRICE];
    [data setValue:@"1" forKey:OrzOSDK_IOS_GOODS_NUM];
    [data setValue:desc forKey:OrzOSDK_IOS_EXTRA];
    [data setValue:roleId forKey:OrzOSDK_IOS_ROLE_ID];
    [data setValue:roleName forKey:OrzOSDK_IOS_ROLE_NAME];
    [data setValue:roleLevel forKey:OrzOSDK_IOS_ROLE_LEVEL];
    [data setValue:serverId forKey:OrzOSDK_IOS_SERVER_ID];
    [data setValue:serverName forKey:OrzOSDK_IOS_SERVER_NAME];
    [[OrzOSDK getSharedInstance] startOrzOSDKRegcharg:data];
        // --- sdk ends ---
    
}

